  render() {
    return (
      <Router>
        <div>
          <Header/>
          <NavBar/>
          <Route  exact path = "/" component = {Homepage}/>
          <Route  exact path = "/bags" component = {Bags}/>
          <Route  exact path = "/bags/:id" component = {Bag}/>

          {/* <UserRegisterForm/> */}
          {/* <ShoppingCart/> */}
          {/* <AdminNew/> */}
          {/* <AdminLogin/> */}
          {/* <AdminCategory/> */}
          {/* <AdminDeleteUpdate stock={bags}/> */}
          {/* <AdminUpdate/> */}
          <Footer/>
        </div>
      </Router>
    );
  }
}
